import React from 'react';
import { Switch, Route } from 'react-router';
import Home from './Home';

const Dumbbells=()=>{
    return(<>
        <Switch>
            <Route path="/" component={Home}/>
            <Route/>
            <Route/>
            <Route/>
        </Switch>
    </>);
};
export default Dumbbells;
